sys_variable_value.value:
(function execute(inputs, outputs) {

try{
	var input={};
  	input['u_pt'] = JSON.parse(inputs.pt); // Integer 
	input['u_age'] = JSON.parse(inputs.age); // Integer 
	input['u_product_id'] = inputs.productId; // String 
	input['u_variant_id'] = inputs.variantId; // String 
	input['u_pt_option'] = inputs.pptoption; // String 
	input['u_frequency'] = inputs.freq; // String 
//	gs.info(JSON.stringify());
	var dt = new sn_dt.DecisionTableAPI();
  	var response = dt.getDecision('e148e19447341a10e9ddbf66706d4346', input);
  
	var result_elements = response.result_elements;
 	var u_is_pt_valid = result_elements.u_is_pt_valid.getValue();  // True/False
	var u_pt_value = result_elements.u_pt_value.getValue();  // Integer

	outputs.bool=u_is_pt_valid;
	outputs.value=u_pt_value;

}
catch(e){
	outputs.code=400;
	outputs.message="Internal Server Error"
}



})(inputs, outputs);

